bi.dist.mixture=function(mixing_distribution, component_distributions, validate_args=py_none(), shape=c(), sample=FALSE, seed=0, name='x') {    shape=do.call(tuple, as.list(as.integer(shape)));    seed=as.integer(seed);    bi$bi$dist$mixture(mixing_distribution,  component_distributions,  validate_args= validate_args,  shape= shape,  sample= sample,  seed= seed,  name= name)}
